import React,{useState,useEffect} from "react";
import './App.css';
import { ThemeProvider as MuithemeProvider } from "@material-ui/core/styles";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import AppNavbar from './components/navigation/AppNavbar';
import { useStateValue } from './context/store';
import Theme from './theme/Theme';
import {Grid} from "@material-ui/core";
import Demand from './components/demand/Demand';
import Survey from './components/survey/Survey';
import ListDemand from './components/demand/ListDemand';
import ListSurvey from './components/survey/ListSurvey';
import Report from './components/report/Report'; 
import RouteSecurity from './components/navigation/RouteSecurity'
import Login from './components/security/Login';

function App() {

  const [startApp, setStartApp] = useState(false);

  useEffect(() => {
    if (!startApp) {

    }
  }, [startApp]);

  return startApp === false ? null :  (
    <React.Fragment>
      <Router>
        <MuithemeProvider theme={Theme}>
        <AppNavbar />
            <Grid container>
            <Switch>
              <Route
                exact
                path="/auth/login"
                component={Login}
              />
              <RouteSecurity
                exact
                path="/demand"
                component={Demand}
              />
              <RouteSecurity
                exact
                path="/listdemand"
                component={ListDemand}
              />
               <RouteSecurity
                exact
                path="/report"
                component={Report}
              />
              <RouteSecurity
                exact
                path="/survey"
                component={Survey}
              />
              <RouteSecurity
                exact
                path="/listsurvey"
                component={ListSurvey}
              />
              </Switch>
            </Grid>
        </MuithemeProvider>
      </Router>
    </React.Fragment>
  );
}

export default App;
